import React,{Component} from 'react';
import './Admin.css'
// import axios from "axios"
import axios, { post } from 'axios';
import {
    BrowserRouter as Router,
    Route, NavLink, Switch,Link
} from "react-router-dom";
import Addproduct from './Addproduct/Addproduct';
class Admin extends Component{
    render(){
      return(
        <Router>
            <div className="headeradmin">
                <img src="http://localhost:4000/logo"  className="logo" alt="a"></img>
            </div>
            <div className="cac">
                <div className="nav1">
                    <div>
                    <img src="http://localhost:4000/logo"  className="logo" alt="a"></img>
                    </div>
                    <ul>
                        <li><Link to='/admin/addproduct'><i class="fas fa-plus"></i>Thêm sản phẩm</Link></li>
                        <li><i class="fas fa-plus"></i>Thêm sản phẩm</li>
                        <li><i class="fas fa-plus"></i>Thêm sản phẩm</li>
                        <li><i class="fas fa-plus"></i>Thêm sản phẩm</li>
                        <li><i class="fas fa-plus"></i>Thêm sản phẩm</li>
                    </ul>
                </div>
                <Route path='/admin/addproduct' component={Addproduct}></Route>
            </div>
        </Router>
      )
    }
}
export default Admin;
